import React, { useState } from 'react';
import { Container, Row, Col, Card, Form, Button, Tab, Tabs } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import { toast } from 'react-toastify';
import axios from 'axios';
import './../App.css';

function Login({ onLogin }) {
  const navigate = useNavigate();
  const [loginData, setLoginData] = useState({ email: '', password: '' });
  const [registerData, setRegisterData] = useState({ 
    name: '', 
    email: '', 
    password: '', 
    confirmPassword: '' 
  });
  const [loading, setLoading] = useState(false);

  const handleLogin = async (e) => {
    e.preventDefault();
    setLoading(true);
    
    try {
      const response = await axios.post(
        `${process.env.REACT_APP_API_URL || 'http://localhost:5000/api'}/auth/login`,
        loginData
      );
      
      onLogin(response.data.token);
      localStorage.setItem('user', JSON.stringify(response.data.user));
      toast.success('Welcome to Drunk Donuts! üç©');
      navigate('/home');
    } catch (error) {
      toast.error(error.response?.data?.error || 'Login failed');
    } finally {
      setLoading(false);
    }
  };

  const handleRegister = async (e) => {
    e.preventDefault();
    
    if (registerData.password !== registerData.confirmPassword) {
      toast.error('Passwords do not match');
      return;
    }
    
    setLoading(true);
    
    try {
      const response = await axios.post(
        `${process.env.REACT_APP_API_URL || 'http://localhost:5000/api'}/auth/register`,
        {
          name: registerData.name,
          email: registerData.email,
          password: registerData.password
        }
      );
      
      onLogin(response.data.token);
      localStorage.setItem('user', JSON.stringify(response.data.user));
      toast.success('Account created successfully! üéâ');
      navigate('/home');
    } catch (error) {
      toast.error(error.response?.data?.error || 'Registration failed');
    } finally {
      setLoading(false);
    }
  };

  const handleGoogleLogin = () => {
    toast.info('Google login coming soon!');
  };

  return (
    <Container className="login-container d-flex align-items-center justify-content-center" style={{ minHeight: '100vh' }}>
      <Row className="w-100" style={{ maxWidth: '1000px' }}>
        <Col lg={6} className="d-none d-lg-flex align-items-center">
          {/* Logo and Branding Side */}
          <div className="login-branding text-center">
            <img 
              src="/logo.png" 
              alt="Drunk Donuts Logo" 
              className="login-logo mb-4"
              style={{ width: '150px', height: '150px' }}
              onError={(e) => {
                e.target.onerror = null;
                e.target.src = "https://cdn-icons-png.flaticon.com/512/3082/3082383.png";
              }}
            />
            <h1 className="display-4 fw-bold mb-3" style={{ color: '#f26175' }}>
              DRUNK DONUTS
            </h1>
            <p className="lead" style={{ color: '#666' }}>
              Welcome to the sweetest experience!<br/>
              Sign in to explore our delicious collection.
            </p>
            <div className="features mt-5">
              <div className="feature-item mb-3">
                <span className="feature-icon"></span>
                <span className="feature-text"></span>
              </div>
              <div className="feature-item mb-3">
                <span className="feature-icon"></span>
                <span className="feature-text"></span>
              </div>
              <div className="feature-item">
                <span className="feature-icon">üçï</span>
                <span className="feature-text">Fresh Pizza Selection</span>
              </div>
            </div>
          </div>
        </Col>
        
        <Col lg={6}>
          <Card className="login-card shadow-lg border-0">
            <Card.Body className="p-5">
              <div className="text-center mb-4">
                <h2 className="fw-bold" style={{ color: '#f26175' }}>Welcome Back!</h2>
                <p className="text-muted">Sign in to your account</p>
              </div>
              
              <Tabs defaultActiveKey="login" className="mb-4">
                <Tab eventKey="login" title="Login">
                  <Form onSubmit={handleLogin}>
                    <Form.Group className="mb-3">
                      <Form.Label>Email address</Form.Label>
                      <Form.Control
                        type="email"
                        placeholder="Enter email"
                        value={loginData.email}
                        onChange={(e) => setLoginData({...loginData, email: e.target.value})}
                        required
                        className="form-control-premium"
                      />
                    </Form.Group>

                    <Form.Group className="mb-3">
                      <Form.Label>Password</Form.Label>
                      <Form.Control
                        type="password"
                        placeholder="Password"
                        value={loginData.password}
                        onChange={(e) => setLoginData({...loginData, password: e.target.value})}
                        required
                        className="form-control-premium"
                      />
                    </Form.Group>

                    <Button 
                      variant="primary" 
                      type="submit" 
                      className="w-100 mb-3 cta-btn"
                      disabled={loading}
                    >
                      {loading ? 'Logging in...' : 'Login'}
                    </Button>
                  </Form>
                </Tab>
                
                <Tab eventKey="register" title="Register">
                  <Form onSubmit={handleRegister}>
                    <Form.Group className="mb-3">
                      <Form.Label>Full Name</Form.Label>
                      <Form.Control
                        type="text"
                        placeholder="Enter your name"
                        value={registerData.name}
                        onChange={(e) => setRegisterData({...registerData, name: e.target.value})}
                        required
                        className="form-control-premium"
                      />
                    </Form.Group>

                    <Form.Group className="mb-3">
                      <Form.Label>Email address</Form.Label>
                      <Form.Control
                        type="email"
                        placeholder="Enter email"
                        value={registerData.email}
                        onChange={(e) => setRegisterData({...registerData, email: e.target.value})}
                        required
                        className="form-control-premium"
                      />
                    </Form.Group>

                    <Form.Group className="mb-3">
                      <Form.Label>Password</Form.Label>
                      <Form.Control
                        type="password"
                        placeholder="Password (min 6 characters)"
                        value={registerData.password}
                        onChange={(e) => setRegisterData({...registerData, password: e.target.value})}
                        required
                        minLength={6}
                        className="form-control-premium"
                      />
                    </Form.Group>

                    <Form.Group className="mb-3">
                      <Form.Label>Confirm Password</Form.Label>
                      <Form.Control
                        type="password"
                        placeholder="Confirm password"
                        value={registerData.confirmPassword}
                        onChange={(e) => setRegisterData({...registerData, confirmPassword: e.target.value})}
                        required
                        className="form-control-premium"
                      />
                    </Form.Group>

                    <Button 
                      variant="success" 
                      type="submit" 
                      className="w-100 cta-btn"
                      disabled={loading}
                    >
                      {loading ? 'Creating account...' : 'Register'}
                    </Button>
                  </Form>
                </Tab>
              </Tabs>
              
              <div className="text-center">
                <p className="text-muted mb-3">Or continue with</p>
                <Button 
                  variant="outline-danger" 
                  className="w-100 mb-3"
                  onClick={handleGoogleLogin}
                >
                  <i className="fab fa-google me-2"></i>
                  Google
                </Button>
                
